input = ""

def solution(numCharacters):
    window = {}

    for i in range(numCharacters):
        if input[i] not in window:
            window[input[i]] = 1
        else:
            window[input[i]] += 1

    for i in range(numCharacters, len(input)):
        if input[i] not in window:
            window[input[i]] = 1
        else:
            window[input[i]] += 1
        
        window[input[i-numCharacters]] -= 1
        
        if len(list(filter(lambda x: x > 1, window.values()))) == 0:
            return i + 1

print(solution(4))     # Part 1
print(solution(14))    # Part 2